import { FiUsers, FiChevronRight } from "react-icons/fi";
import Logo from "../Img/logo.png "
function Menu() {

    return (
       <nav className="sidebar">
        <header>
            <div className="image-text">
                <span className="image">
                    <img src={Logo} alt="Logo"></img>
                </span>
            </div>
        </header>
       </nav>

    )
}

export default Menu
